Merliah is een surfkampioene uit Malibu. Het ene moment is ze nog een doodgewone tiener, maar een paar tellen later ontdekt ze een schokkend familiegeheim: ze is een zeemeermin! Voor Merliah en haar dolfijnenvriend Zuma begint een avontuurlijke onderzeese zoektocht naar haar moeder, de koningin van Oceana.


&quot;Surf's up for Barbie as she returns as Merliiah, the fun and fashionable surfing champion who's also a magical mermaid princess! In this exciting sea-quel, Merliah makes a splash when she heads to Australia for the ultimate surfing competition. When the evil mermaid Eris escapes from her whirlpool with plans to take over the throne of Oceana, Merliah and her sea friends dive in to stop her. It's a fresh new adventure where Merliah learns that anything is possible if you stay true to yourself.&quot; 
